import React from 'react';
import styled from 'styled-components';
// import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';
// import Container from 'react-bootstrap/Container';


const FlexWrapper = styled('div')`

    border: 1px solid #c7c2c2;
    background: #fff;
    margin-bottom: 10px;
    min-height: 100px;
    border-radius: 10px;
    padding: 10px 0;

`


const TextWrap = styled('div')`
	font-size:15px;
	font-weight:bold;
	color:#000066;
`
const ParaWrap = styled('div')`
	font-size:12px;
	color:grey;
	margin-top:15px;

`
const ButtonWrap = styled('div')`
	border: 1px solid #007bff;
    color: #fff;
    font-size: 13px;
    background:#007bff;
    width:7%;
    border-radius:5px;
    font-weight:bold;
    padding: 3px 5px;
    margin-top:20px;
    text-align:centre;

`
const DoseWrap = styled('div')`
	margin-left:100px;
`
const Row = styled('div')`
	width:100%;
	border : 1px solid #007bff;
    margin-top:5px;
	height:30px;

`
const Col = styled('div')`
	margin-left:100px;


`







const Card = () => (
	<FlexWrapper>
        <TextWrap>HSC GOVINDPUR</TextWrap>
        <Row></Row>






	</FlexWrapper>
)

export default Card;
